// DeleteUniqueIndexCache 删除索引存在的缓存
func (u *UserMembershipRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.UserMembership) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, u.cache.Key(CacheUserMembershipByConditionPrefix))
	keys = append(keys, u.cache.Key(CacheUserMembershipUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[u.cache.Key(CacheUserMembershipByIDPrefix, item.ID)] = struct{}{}
			KeyMap[u.cache.Key(CacheUserMembershipUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[u.cache.Key(CacheUserMembershipByUserIDPrefix, item.UserID)] = struct{}{}
			KeyMap[u.cache.Key(CacheUserMembershipUnscopedByUserIDPrefix, item.UserID)] = struct{}{}
			KeyMap[u.cache.Key(CacheUserMembershipByMembershipTypePrefix, item.MembershipType)] = struct{}{}
			KeyMap[u.cache.Key(CacheUserMembershipUnscopedByMembershipTypePrefix, item.MembershipType)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := u.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
